  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. National Oceanographic Data Center
  (NODC) operates the Global Argo Data Repository(GADR as the long-term archive for
  the International Global Argo Project (for additional information about Argo,see
  http://www.argo.ucsd.edu/(last accessed Jun 2010)). Argo data archived by the US
  NODC on a weekly basis starting the second quarter of FY 2003, may include real-time
  and/or delayed-mode profiles of ocean temperature and salinity, as well as related
  conductivity and/ or pressure measurements(if any),collected by Argo profiling floats.\",\n\t\"owner_org\":
